  false,\n\t\"url\": null,\n\t\"notes\": \"NODC Accession 0108369 includes chemical,
  discrete sample, physical and profile data collected from MARION DUFRESNE in the
  Indian Ocean from 2011-01-14 to 2011-02-20 and retrieved during cruise CLIVAR_OISO19.
  These data include ALKALINITY, DELTA CARBON-13, DISSOLVED INORGANIC CARBON, DISSOLVED
  OXYGEN, HYDROSTATIC PRESSURE, NITRATE, PHOSPHATE, SALINITY, SILICATE and WATER TEMPERATURE.
  The instruments used to collect these data include Alkalinity titrator, CTD, Potentiometric
  titrator for dissolved inorganic carbon (DIC) and total alkalinity (TA) measurement
  and bottle. These data were collected by C. Lo Monaco of Universite Pierre et Marie
  Curie; Institut Pierre Simon Laplace; Laboratoire D'Oceanographie et du Climat:
  Experimentations et Approches Numeriques and Nicolas Metzl of Universite Pierre
  et Marie Curie; Laboratoire de Biogeochimie et Chimie Marines as part of the CLIVAR_OISO19
  data set.nnThe International CLIVAR Global Ocean Carbon and Repeat Hydrography Program
  carries out a systematic and global re-occupation of select WOCE/JGOFS hydrographic
  sections to quantify changes in storage and transport of heat, fresh water, carbon
  dioxide (CO2), and related parameters.\",\n\t\"license_title\": null,\n\t\"extras\":
